import Quote from "./Quote";
import { useState } from "react";




const QuoteList = () => {
    const [quotes, setQuotes] = useState([
        {quote: "tässä quote 1"},
        {quote: "tässä quote 2"},
        {quote: "tässä quote 3"},
        {quote: "tässä quote 4"},
        {quote: "tässä quote 5"},
        {quote: "tässä quote 6"},
    ])
    return (
        <div>
        {
            quotes.map(quote => {
                return (
                    <Quote key={quote + "-" + index} 
                    quote={quote.quote}/>
                )
            })
        }
        </div>
    )
}

export default QuoteList;
